import React from 'react';
import "./App.css";
import { Header } from "./components/Header";
import Balance from "./components/Balance";
import { IncomeExpenses} from "./components/IncomeExpenses";


function App() {
  return (
    <div >
      <Header /> 
      <div className="container">
          <Balance />
          <IncomeExpenses />
      </div>
    </div>
  );
}

export default App;
